import './StudentRecordList.scss';
import { Table, TableHead, TableBody, TableCell, TableRow } from '@material-ui/core';
import EditOutlinedIcon from '@material-ui/icons/EditOutlined';
import CloseIcon from '@material-ui/icons/Close';
import { useState } from 'react';
import ActionButton from '../../components/controls/ActionButton';
import Popup from '../Popup';
import StudentRecordForm from '../SRForm/StudentRecordForm';
import ConfirmDialog from '../ConfirmDialog';
import {getAllStudentRecords, deleteStudentRecord} from '../../services/studentRecordService';

function createData(name, calories, fat, carbs, protein) {
    return { name, calories, fat, carbs, protein };
  }
const studentRecords = [
    {fullName: "Rebeca", rollNo: 1, studentClass: 2, totalSubjects: 5, age: 6 },
    {fullName: "Shawn", rollNo: 2, studentClass: 4, totalSubjects: 7, age: 8 },
    {fullName: "Patrik", rollNo: 3, studentClass: 2, totalSubjects: 5, age: 5 },
    {fullName: "Pokoyo", rollNo: 4, studentClass: 3, totalSubjects: 6, age: 7 },
    {fullName: "Elly", rollNo: 5, studentClass: 3, totalSubjects: 6, age: 6 },
    {fullName: "Spongebob", rollNo: 6, studentClass: 2, totalSubjects: 5, age: 5 }
]

function StudentRecordList(props){
    const [records, setRecords] = useState(studentRecords())
    const [openPopup, setOpenPopup] = useState(false);
    const [confirmDialog, setConfirmDialog] = useState({ isOpen:false, title:'', subTitle:''});

    const onDelete = id => {
        setConfirmDialog({
            ...confirmDialog, isOpen:false
        })
        deleteStudentRecord(id);        
    }
    
    const rows = [
        createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
        createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
        createData('Eclair', 262, 16.0, 24, 6.0),
        createData('Cupcake', 305, 3.7, 67, 4.3),
        createData('Gingerbread', 356, 16.0, 49, 3.9),
      ];

    return(
        <div>
            <Table>
                <TableHead>
                    <TableRow>
                        <TableCell>FullName</TableCell>
                        <TableCell align="right">Roll No.</TableCell>
                        <TableCell align="right">Student Class</TableCell>
                        <TableCell align="right">Total Subjects</TableCell>
                        <TableCell align="right">Age</TableCell>
                        <TableCell> </TableCell>
                        <TableCell> </TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {records.map((row) => (
                        <TableRow key={row.fullName} sx={{ '&:last-child td, &:last-child th': { border: 0 } }} >
                            <TableCell component="th" scope="row">
                                {row.name}
                            </TableCell>
                            <TableCell align="right">{row.rollNo}</TableCell>
                            <TableCell align="right">{row.studentClass}</TableCell>
                            <TableCell align="right">{row.totalSubjects}</TableCell>
                            <TableCell align="right">{row.age}</TableCell>
                            <TableCell>
                                <ActionButton
                                    color = "primary"
                                    onClick = {() => setOpenPopup(true)}
                                    >
                                    <EditOutlinedIcon fontSize="small"/>
                                </ActionButton>
                            </TableCell>
                            <TableCell>
                                <ActionButton
                                    color = "secondary"
                                    onClick={()=> {setConfirmDialog({
                                        isOpen:true,
                                        title:"Delete Student Record",
                                        subTitle:"Do you want to delete Student Record?",
                                        onConfirm:()=>{onDelete(row.name)}
                                    })}}>
                                    <CloseIcon fontSize="small"/>
                                </ActionButton>
                            </TableCell>
                        </TableRow>
                    ))}
                </TableBody>
            </Table>
            <Popup title="Edit Student Record" 
                    openPopup = {openPopup} 
                    setOpenPopup = {setOpenPopup} >
                <StudentRecordForm/>
            </Popup>
            <ConfirmDialog confirmDialog= {confirmDialog}
                            setConfirmDialog= {setConfirmDialog}/>
        </div>
    )
}

export default StudentRecordList;
